import React, { Component } from 'react';

import './App.css';
import Project from "./projects-data";
import {Layout, Header, HeaderRow, Navigation, Drawer, Content} from 'react-mdl';

class App extends Component {
  state = {
    project: Project
  }

  render() {
    return (
      <div className="demo-big-content">
      <Layout>
          <Header waterfall hideTop>
              <HeaderRow title="Title">

              </HeaderRow>
              <HeaderRow>
                  <Navigation>
                      <a href="#">Link</a>
                      <a href="#">Link</a>
                      <a href="#">Link</a>
                      <a href="#">Link</a>
                  </Navigation>
              </HeaderRow>
          </Header>
          <Drawer title="Title">
              <Navigation>
                  <a href="#">Link</a>
                  <a href="#">Link</a>
                  <a href="#">Link</a>
                  <a href="#">Link</a>
              </Navigation>
          </Drawer>
          <Content>
              <div className="page-content" />
          </Content>
      </Layout>
  </div>
    );
  }
}

export default App;
